css:
.editor {
  background: #202022;
  color: #d5d5d1;
  line-height: 1.5em;
}
.editor .selection .region {
  background: rgba(255, 255, 255, 0.1);
}
.editor .scroll-view .underlayer {
  background: url(data:image/png;base64,);
}
.editor .wrap-guide {
  background: #2f2f2f;
}
.editor .vertical-scrollbar {
  top: 5px;
  right: 5px;
  bottom: 5px;
}
.editor .gutter {
  background: #141417;
  margin-right: 3px;
  overflow: visible;
  box-shadow: inset -1px 0 #2f2f2f;
}
.editor .line-number {
  color: #5f5f5f;
}
.editor .line-number.cursor-line {
  background: rgba(255, 255, 255, 0.04);
  position: relative;
}
.editor .line-number.cursor-line:after {
  content: '';
  background: rgba(255, 255, 255, 0.1);
  width: 4px;
  height: 100%;
  position: absolute;
  top: 0;
  right: -3px;
  bottom: 0;
}
.editor .line-number.cursor-line-no-selection {
  background: rgba(0, 0, 0, 0.4);
}
.editor .line-number.cursor-line-no-selection:after {
  background: rgba(0, 0, 0, 0.3);
  width: 3px;
}
.editor .lines {
  box-shadow: none;
}
.editor .indent-guide {
  box-shadow: none;
}
.editor .indent-guide:not(:first-child) {
  box-shadow: inset 1px 0 #2f2f2f;
}
.editor .line.cursor-line {
  background: rgba(0, 0, 0, 0.3);
}
.editor .invisible-character {
  color: #5a5958;
}
.editor .text .comment,
.editor .source .comment {
  font-style: italic;
  color: #5a5958;
}
.editor .text .meta.function .name,
.editor .source .meta.function .name {
  color: #7abcd1;
}
.editor .text .meta.brace,
.editor .source .meta.brace {
  color: #918970;
}
.editor .text .keyword.operator,
.editor .source .keyword.operator {
  color: #a38259;
}
.editor .text .keyword.control,
.editor .source .keyword.control {
  color: #cf8554;
}
.editor .text .variable.assignment,
.editor .source .variable.assignment {
  color: #b8b394;
}
.editor .text .variable.parameter,
.editor .source .variable.parameter {
  color: #dad672;
}
.editor .text .variable.instance,
.editor .source .variable.instance {
  color: #7ac096;
}
.editor .text .string,
.editor .source .string {
  color: #98c06c;
}
.editor .text .string.regexp,
.editor .source .string.regexp {
  color: #eebc71;
}
.editor .text .string .embedded.source,
.editor .source .string .embedded.source {
  color: #6abe9d;
}
.editor .text .storage.type.function,
.editor .source .storage.type.function {
  color: #a38259;
}
.editor .text .storage.modifier,
.editor .source .storage.modifier {
  color: #a38259;
}
.editor .text .storage.class,
.editor .source .storage.class {
  color: #db8286;
}
.editor .text .entity.instance,
.editor .source .entity.instance {
  color: #74afb4;
}
.editor .text .entity.type.object,
.editor .source .entity.type.object {
  color: #db8286;
}
.editor .text .support.class,
.editor .source .support.class {
  color: #74afb4;
}
.editor .text .support.function,
.editor .source .support.function {
  color: #eebc71;
}
.editor .text .constant,
.editor .source .constant {
  color: #f1ee91;
}
.editor .text .language.variable,
.editor .source .language.variable {
  color: #f1ee91;
}
.source.css .entity.tag {
  color: #eebc71;
}
.source.css .entity.class,
.source.css .entity.id {
  color: #7abcd1;
}
.source.css .entity.pseudo-class,
.source.css .entity.pseudo-element {
  color: #a38259;
}
.source.css .selector .punctuation.function {
  color: #a38259;
}
.source.css .property-value {
  color: #b8b394;
}
.source.css .punctuation.separator {
  color: #5f5f5f;
}
.source.css .punctuation.terminator {
  color: #5f5f5f;
}
.source.css .punctuation.property-list {
  color: #5f5f5f;
}
.source.css .keyword.unit {
  color: #7ac096;
}
.source.css .keyword.important {
  color: #cf8554;
}
.text.html .meta.tag .punctuation.tag {
  color: #5f5f5f;
}
.text.html .meta.tag .tag.name {
  color: #918970;
}
.text.html .meta.tag .attribute-name {
  color: #dad672;
}
.text.html .string .embedded {
  color: #d5d5d1;
}
.text.php .variable {
  color: #b8b394;
}
.source.scss .entity.placeholder {
  color: #74afb4;
}
.source.scss .entity.entity.reference + .property-name .invalid {
  color: #74afb4;
}
.source.scss .variable:not(.interpolation):not(.set) {
  color: #db8286;
}
.source.less .variable:not(.interpolation):not(.set) {
  color: #db8286;
}
.source.gfm .markup {
  color: #b8b394;
}
.source.gfm .link {
  color: #5a5958;
}
.source.gfm .link .entity {
  color: #b8b394;
}
.source.gfm .link .link {
  color: #f1ee91;
}
.source.gfm .italic {
  font-style: italic;
}
.source.gfm .bold {
  font-weight: 700;
}
.source.gfm .code .support.gfm,
.source.gfm .raw .support.gfm {
  color: #5a5958;
}
.source.gfm .quote {
  color: #74afb4;
}
